def SHA1_attack_1(n, s):
    a = 0
    if n == 24:  # a() a
        a = 0xffffffffef
    b = 0xffffffffffff
    target = bin(int(s, 16))[2:].rjust(160, '0')[:n]
    if n <= 12:
        t = target.ljust(12, '0')
        ans = dic[t]
        return ans
